import React from "react";


export default function ShoppingList(): JSX.Element {
    const items = [
        {id: 1, product: "Lemon", quantity: 3},
        {id: 2, product: "Chicken", quantity: 2},
    ]
    return (
        <div>
            <h1>Shopping List</h1>
            <ul>
                {items.map(item => (
                    <li>{item.product}</li>
                ))}
            </ul>
        </div>
    )
}
